import { Pipe, PipeTransform } from '@angular/core';

@Pipe({
  name: 'sellingprice'
})
export class SellingPricePipe implements PipeTransform {
  transform(mrp: number, discount: number): number {
    if (!mrp) return 0;
    if (discount <= 0) return mrp;

    return Math.round(mrp - (discount * mrp) / 100);
  }
}

