import { BehaviorSubject, lastValueFrom } from 'rxjs';

interface CatsProducts {
  [key: string]: Array<Product>;
}

@Injectable({
  providedIn: 'root'
})
export class ProductQueryService {
  // All products cache
  private $liveProducts = new BehaviorSubject<Array<Product>>([]);
  // Categories products cache
  private $liveCatsProducts = new BehaviorSubject<CatsProducts>(null);

  constructor(
    private http: HttpClient,
    @Inject('API_URLS') private API_URLS: any
  ) {}

  private addToCache(products: Array<Product>): void {
    const pIds = this.$liveProducts.value.map((p) => p.id);
    const toAddPs = products.filter((p) => !pIds.includes(p.id));

    this.$liveProducts.next([...this.$liveProducts.value, ...toAddPs]);
  }

  public async getProductsByCategories(
    categoryIds: Array<string>,
    force: boolean = false
  ): Promise<Array<Product>> {
    // get from cache
    const liveCatsPs =
      this.$liveCatsProducts.value &&
      this.$liveCatsProducts.value[categoryIds.join('-')];

    if (!force && liveCatsPs) {
      return liveCatsPs;
    }

    try {
      const productR: any = await lastValueFrom(
        this.http.get(
          `${this.API_URLS.PRODUCTS.LIST}?categoryIds=${categoryIds}`
        )
      );

      const products = productR.map((p) => new Product(p));

      if (products?.length) {
        this.addToCache(products);
        this.$liveCatsProducts.next({
          ...(this.$liveCatsProducts.value || {}),
          [categoryIds.join('-')]: [...products]
        });
        return products;
      } else {
        return null;
      }
    } catch (error: any) {
      throw error;
    }
  }

  public async getProduct(
    id: string,
    force: boolean = false
  ): Promise<Product> {
    // get from cache
    const p = this.$liveProducts.value.find((p) => p.id === id);

    if (!force && p) {
      return p;
    }

    try {
      const productR: any = await lastValueFrom(
        this.http.get(`${this.API_URLS.PRODUCTS.LIST}/${id}`)
      );

      const product = new Product(productR);

      this.addToCache([product]);

      return product;
    } catch (error: any) {
      throw error;
    }
  }

  public async getProductsByIds(
    ids: Array<string>,
    force: boolean = false
  ): Promise<Array<Product>> {
    // get from cache
    let pCache = [];
    let notFoundIds = [];

    if (!force && this.$liveProducts.value?.length) {
      this.$liveProducts.value.forEach((p) => {
        if (ids.includes(p.id)) {
          pCache.push(p);
        } else {
          notFoundIds.push(p.id);
        }
      });

      if (!notFoundIds.length) {
        return pCache;
      }
    }

    try {
      const productR: any = await lastValueFrom(
        this.http.get(`${this.API_URLS.PRODUCTS.LIST}?ids=${notFoundIds}`)
      );

      const products = productR.map((p) => new Product(p));

      this.addToCache(products);
      return [...products, ...pCache];
    } catch (error: any) {
      throw error;
    }
  }
}

