import { Injectable, Injector, inject } from '@angular/core';
import {
  AsyncValidatorFn,
  FormBuilder,
  FormGroup,
  ValidationErrors,
  ValidatorFn,
  Validators
} from '@angular/forms';
import { FormConfigGroup } from '../classes/config-group.class';
import { FormConfigParameter } from '../classes/config-parameter.class';
import * as syncValidators from '../sync-validators';
import * as asyncValidators from '../async-validators';
import { SyncConfigValidator } from '../classes/sync-config-validator.class';
import { AsyncConfigValidator } from '../classes/async-config-validator.class';
import { UpdateOnEnum } from '../enums/updateon.enum';
import { BehaviorSubject, Observable, Subscription } from 'rxjs';
import { FormControlValue } from '../interfaces/control-value.interface';

@Injectable()
export class FormConfigService {
  private injectedAsyncValidators = {};
  private params: FormConfigGroup = null;
  private $form = new BehaviorSubject<FormGroup>(null);
  private $controls = new BehaviorSubject<any>(null);
  private $valueChanges = new BehaviorSubject<any>(null);
  private $controlValueChanges = new BehaviorSubject<FormControlValue>(null);
  private $statusChanges = new BehaviorSubject<ValidationErrors>(null);

  private valueChangesSubscription: Subscription = null;
  private statusChangesSubscription: Subscription = null;
  private controlValuesSubscriptions = {};

  constructor(private fb: FormBuilder) {
    asyncValidators &&
      Object.keys(asyncValidators).forEach((key) => {
        this.injectedAsyncValidators[key] = inject(asyncValidators[key]);
      });
  }

  public get form(): Observable<FormGroup> {
    return this.$form.asObservable();
  }

  public get controls(): Observable<any> {
    return this.$controls.asObservable();
  }

  public get valueChanges(): Observable<any> {
    return this.$valueChanges.asObservable();
  }

  public get controlValueChanges(): Observable<FormControlValue> {
    return this.$controlValueChanges.asObservable();
  }

  public get statusChanges(): Observable<ValidationErrors> {
    return this.$statusChanges.asObservable();
  }

  private getSyncValidators(
    sVlds: Array<SyncConfigValidator>
  ): Array<ValidatorFn> {
    return (
      sVlds?.map((vd) => {
        let vld;
        switch (vd.name) {
          case 'required':
          case 'email':
            vld = Validators[vd.name];
            break;
          case 'min':
          case 'max':
          case 'minLength':
          case 'maxLength':
            vld = Validators[vd.name](vd.params[0]);
            break;
          default:
            vld = syncValidators[vd.name];
            break;
        }

        if (!vld) {
          throw new Error(`${vd.name} validator does not exist.`);
        }

        return vld;
      }) || []
    );
  }

  private getAsyncValidators(
    sVlds: Array<AsyncConfigValidator>
  ): Array<AsyncValidatorFn> {
    return (
      sVlds?.map((vd) => {
        const asyncValidator = this.injectedAsyncValidators[vd.name];
        if (!asyncValidator) {
          throw new Error(`${vd.name} validator does not exist.`);
        }

        if (vd.url) asyncValidator['url'] = vd.url;
        if (vd.imageDimsName)
          asyncValidator['imageDimsName'] = vd.imageDimsName;

        return asyncValidator.validate.bind(asyncValidator);
      }) || []
    );
  }

  private removeControlValueChangeSubscriptions(controls): any {
    if (!controls) return null;

    Object.keys(controls).forEach((key) => {
      const control = controls[key];
      // group
      if (control.controls) {
        control.groupControl?.unsubscribe();
        this.removeControlValueChangeSubscriptions(control.controls);
      } else {
        // single control
        control?.unsubscribe();
      }
    });
  }

  private addControlValueChangeSubscriptions(controls: any): any {
    if (!controls) return null;
    const subscriptions = {};

    Object.keys(controls).forEach((key) => {
      const control = controls[key];
      // group
      if (control.controls) {
        subscriptions[key] = {
          groupControl: control.groupControl.valueChanges.subscribe((value) =>
            this.$controlValueChanges.next({
              key,
              value,
              control: control.groupControl
            })
          ),
          controls: this.addControlValueChangeSubscriptions(control.controls)
        };
      } else {
        // single control
        subscriptions[key] = control.valueChanges.subscribe((value) =>
          this.$controlValueChanges.next({
            key,
            value,
            control
          })
        );
      }
    });

    return subscriptions;
  }

  private getControls(form: FormGroup): any {
    if (!form?.controls) return null;
    const controls = {};

    Object.keys(form.controls).forEach((key) => {
      const control = form.controls[key];
      if (control['controls']) {
        controls[key] = {
          groupControl: form.get(key),
          controls: this.getControls(control as FormGroup)
        };
      } else {
        controls[key] = form.get(key);
      }
    });

    return controls;
  }

  private getParamAsyncValidators(
    cParam: FormConfigParameter
  ): Array<AsyncValidatorFn> {
    return this.getAsyncValidators(cParam.asyncValidators);
  }

  private getControlErrors(controls): ValidationErrors {
    let errors = null;

    Object.keys(controls).forEach((key) => {
      const control = controls[key];
      if (control.controls) {
        errors = {
          ...(errors || {}),
          ...(this.getControlErrors(control.controls) || {})
        };
      } else {
        const controlErrors = controls[key].errors;
        if (controlErrors) {
          errors = { ...(errors || {}), controlErrors };
        }
      }
    });

    return errors;
  }

  private removeAsyncValidators(controls): void {
    Object.keys(controls).forEach((key) => {
      const control = controls[key];
      if (control.controls) {
        control.clearAsyncValidators();
        this.removeAsyncValidators(control.controls);
      } else {
        control.clearAsyncValidators();
      }
    });
  }

  private addAsyncValidators(controls, params: FormConfigGroup): void {
    Object.keys(controls).forEach((key) => {
      const param = params[key];
      const control = controls[key];
      if (control.controls) {
        this.addAsyncValidators(control.controls, param.params);
      } else {
        control.setAsyncValidators(this.getParamAsyncValidators(params[key]));
      }
    });
  }

  public getFormGroup(
    configGroup: FormConfigGroup,
    formParamValues: any
  ): FormGroup {
    if (!configGroup) {
      return null;
    }

    const params = {};

    Object.keys(configGroup).forEach((key) => {
      const cParam: FormConfigParameter = configGroup[key];
      let updateOn = cParam.asyncValidators?.length
        ? { updateOn: UpdateOnEnum.blur }
        : cParam.updateOn
        ? { updateOn: cParam.updateOn }
        : {};

      if (
        ['checkbox', 'radio', 'select', 'date'].includes(cParam.controlType)
      ) {
        updateOn = { updateOn: UpdateOnEnum.change };
      }

      // Param is a groupParam, then create a form group
      if (cParam.controlType === 'group') {
        params[key] = this.getFormGroup(
          cParam.params,
          formParamValues ? formParamValues[key] : null
        );
      } else {
        // Param is Control
        params[key] = [
          cParam.disabled
            ? {
                value:
                  (formParamValues ? formParamValues[key] : null) ||
                  cParam.value,
                disabled: true
              }
            : (formParamValues ? formParamValues[key] : null) || cParam.value,
          this.getSyncValidators(cParam.syncValidators),
          this.getAsyncValidators(cParam.asyncValidators),
          updateOn
        ];
      }
    });

    return this.fb.record(
      { ...params },
      {
        updateOn: UpdateOnEnum.blur
      }
    );
  }

  public initForm(configGroup: FormConfigGroup, formParamValues: any): void {
    this.params = configGroup;

    // Unsubscribe form subscriptions if any
    this.valueChangesSubscription &&
      this.valueChangesSubscription.unsubscribe();
    this.statusChangesSubscription &&
      this.statusChangesSubscription.unsubscribe();
    this.removeControlValueChangeSubscriptions(this.controlValuesSubscriptions);

    const newForm = this.getFormGroup(this.params, formParamValues);
    const controls = this.getControls(newForm);

    this.$form.next(newForm);
    this.$controls.next(controls);

    // Subscribe again the subscriptions
    if (this.$form.value) {
      // Value change subscription
      this.valueChangesSubscription = this.$form.value.valueChanges.subscribe(
        () => {
          this.$valueChanges.next(this.$form.value.getRawValue());
        }
      );
      // Status change subscription
      this.statusChangesSubscription = this.$form.value.statusChanges.subscribe(
        () => {
          this.$statusChanges.next(this.getControlErrors(this.$controls.value));
        }
      );

      // Controls value change subscriptions
      this.controlValuesSubscriptions =
        this.addControlValueChangeSubscriptions(this.$controls.value) || {};
    }
  }

  public patchValue(value: any): void {
    if (!this.$form.value || !value) return;

    // Remove and re-add async validator to skip validation on patchValue
    this.removeAsyncValidators(this.$controls.value);

    // Update values
    this.$form.value.patchValue(value, { emitEvent: false });

    // Add back all async validators
    setTimeout(() =>
      this.addAsyncValidators(this.$controls.value, this.params)
    );
  }
}

import { HttpClient } from '@angular/common/http';
import { Injectable } from '@angular/core';
import { BehaviorSubject, Observable, lastValueFrom } from 'rxjs';
import { GlobalConfigParamsEnum } from '../enums/global-config-params.enum';
import {
  RemoteConfigParameter,
  RemoteConfigTemplate
} from 'firebase-admin/lib/remote-config/remote-config-api';

@Injectable({
  providedIn: 'root'
})
export class GlobalConfigService {
  private $url: string = ''; // Will fetch remote config
  private $config = new BehaviorSubject<RemoteConfigTemplate>(null);

  constructor(private http: HttpClient) {}

  public get url(): string {
    return this.$url;
  }

  public set url(v: string) {
    this.$url = v;
  }

  public get config(): Observable<RemoteConfigTemplate> {
    return this.$config.asObservable();
  }
  /**
   * Fetches global config from server
   * Ideally should be called from APP_INITIALIZER
   * @param force
   * @returns
   */
  public async fetch(force: boolean = false): Promise<any> {
    if (!this.url) {
      throw new Error(
        'Url is empty. Please provide api url that can fetch global config.'
      );
    }

    // Serve from cache if available
    if (this.$config.value && !force) {
      return this.$config.value;
    }

    // Fetch from sever database (firebase remote config)

    try {
      const config: any = await lastValueFrom(this.http.get(this.url));
      // Emit next config
      this.$config.next(config);
      return config;
    } catch (error) {
      // reset config
      this.$config.next(null);
      // throw error
      throw error;
    }
  }

  public getValue(key: string | GlobalConfigParamsEnum): any {
    if (!this.$config.value) return null;

    const param = this.$config.value.parameters[key] as RemoteConfigParameter;

    if (param) {
      const value = (param.defaultValue as any)?.value;

      if (param.valueType === 'JSON' && value) {
        return JSON.parse(value);
      }

      return value;
    }

    throw new Error(`Param - ${key} does not exist in global config.`);
  }
}

import { Injectable } from '@angular/core';
import {
  AbstractControl,
  AsyncValidator,
  ValidationErrors
} from '@angular/forms';
import {
  GlobalConfigParamsEnum,
  GlobalConfigService
} from '@annuadvent/ngx-core/global-config';

import { Observable, catchError, map, of } from 'rxjs';
import { ImageDims } from '../interfaces/image-dims.interface';
import { ImageUpload } from '@annuadvent/ngx-common-ui/image-upload';

@Injectable({
  providedIn: 'root'
})
export class ImageValidatorService implements AsyncValidator {
  private $dims: ImageDims = null;
  private $imageDimsName: string | GlobalConfigParamsEnum = null;

  constructor(private gcService: GlobalConfigService) {}

  validate(control: AbstractControl): Observable<ValidationErrors | null> {
    if (
      !control.value ||
      (control.value instanceof Array && !control.value?.length)
    )
      return of(null);

    let imageInfos: Array<ImageUpload> = [];

    if (control.value instanceof Array) {
      imageInfos = control.value;
    } else {
      imageInfos = [control.value];
    }

    const obs = new Observable<ValidationErrors | null>((observer) => {
      this.validateAllImages(imageInfos)
        .then((results) => {
          let message = '';
          if (results instanceof Array) {
            message = results
              .filter((result) => result.status === 'rejected')
              .map((result) => result.reason.imageupload.message)
              .join('</br>');
          }

          if (message) {
            const formError: ValidationErrors = {
              imageupload: {
                message
              }
            };
            observer.error(formError);
          } else {
            observer.error(null);
          }
        })
        .catch((errors: Array<ValidationErrors>) => {
          const formError: ValidationErrors = {
            imageupload: {
              message:
                errors instanceof Array
                  ? errors.map((er) => er?.imageupload?.message).join('\n')
                  : (errors as any)?.imageupload?.message
            }
          };
          observer.error(formError);
        });
    });

    return obs.pipe(
      map((val) => {
        return val;
      }),
      catchError((error) => {
        control.markAsDirty();
        if (error) {
          return of(error);
        } else {
          return of(null);
        }
      })
    );
  }

  public set imageDimsName(v: string | GlobalConfigParamsEnum) {
    this.$imageDimsName = v;
    this.$dims = this.gcService.getValue(this.$imageDimsName);
  }

  private async validateImage(
    imageInfo: ImageUpload
  ): Promise<ValidationErrors> {
    const blb = await imageInfo.getBlobImage();
    return new Promise((resolve, reject) => {
      var reader = new FileReader();
      reader.readAsDataURL(blb);

      reader.onload = (e) => {
        //Initiate the JavaScript Image object.
        const image = new Image();

        //Set the Base64 string return from FileReader as source.
        image.src = e.target.result as string;
        image.onload = () => {
          // Natural size is the actual image size regardless of rendering.
          // The 'normal' `width`/`height` are for the **rendered** size.
          const width = image.naturalWidth;
          const height = image.naturalHeight;

          if (
            this.$dims.width === width &&
            this.$dims.height === height &&
            imageInfo.size <= this.$dims.size * 1024
          ) {
            resolve(null);
          } else {
            const formError: ValidationErrors = {
              imageupload: {
                message: `<strong>${imageInfo.fileName}:</strong> Allowed Image dimensions are width: ${this.$dims.width}, height: ${this.$dims.height} and a maximum file size of ${this.$dims.size}kbs. While current image is having dimensions of width: ${width}, height: ${height} and a file size of ${imageInfo.kbs}kbs`
              }
            };
            reject(formError);
          }

          reader.onload = null;
        };

        image.onerror = (error: any) => {
          const formError: ValidationErrors = {
            imageupload: {
              message:
                imageInfo.fileName + ': ' + error?.message ||
                error?.error?.message ||
                error
            }
          };
          reject(formError);
          reader.onerror = null;
        };
      };
    });
  }

  private async validateAllImages(
    imageInfos: Array<ImageUpload>
  ): Promise<Array<ValidationErrors>> {
    return Promise.allSettled(
