import { ImageUpload } from '@annuadvent/ngx-common-ui/image-upload';
import {
  GlobalConfigParamsEnum,
  GlobalConfigService
} from '@annuadvent/ngx-core/global-config';

@Injectable({
  providedIn: 'root'
})
export class ProductImageResizeService {
  constructor(private gcService: GlobalConfigService) {}

  public async resize(imageUpload: ImageUpload): Promise<Array<Blob>> {
    const { width, height } = this.gcService.getValue(
      GlobalConfigParamsEnum.productImageDimensions
    );

    var reader = new FileReader();

    //Read the contents of Image File.
    reader.readAsDataURL(imageUpload.data);

    const promise = new Promise<Array<Blob>>((resolve, reject) => {
      reader.onload = (e) => {
        //Initiate the JavaScript Image object.
        const image = new Image();

        //Set the Base64 string return from FileReader as source.
        image.src = e.target.result as string;
        image.onload = () => {
          Promise.all([
            this.resizeCanvas(
              image,
              width / 8,
              height / 8,
              imageUpload.mimeType
            ),
            this.resizeCanvas(
              image,
              width / 2,
              height / 2,
              imageUpload.mimeType
            )
          ])
            .then((blbs) => resolve(blbs))
            .catch((error) => reject(error));
        };

        // Reject promise on error
        image.onerror = (error: any) => {
          reject('Error loading Image');
        };
      };
    });

    return promise;
  }

  private async resizeCanvas(
    image: HTMLImageElement,
    width: number,
    height: number,
    mimeType: string
  ): Promise<Blob> {
    return new Promise<Blob>((resolve, reject) => {
      const canvas = document.createElement('canvas');
      canvas.width = width;
      canvas.height = height;
      canvas.getContext('2d').drawImage(image, 0, 0, width, height);
      canvas.toBlob((blb) => {
        if (blb) {
          resolve(blb);
        } else {
          reject(`Failed to resize to ${width}x${height}`);
        }
      }, mimeType);
    });
  }
}

import { HttpClient } from '@angular/common/http';
import { Inject, Injectable } from '@angular/core';
