import { BehaviorSubject, lastValueFrom } from 'rxjs';

interface CatsProducts {
  [key: string]: Array<Product>;
}

@Injectable({
  providedIn: 'root'
})
export class ProductQueryService {
  // All products cache
  private $liveProducts = new BehaviorSubject<Array<Product>>([]);
  // Categories products cache
  private $liveCatsProducts = new BehaviorSubject<CatsProducts>(null);

  constructor(
    private http: HttpClient,
    @Inject('API_URLS') private API_URLS: any
  ) {}

  private addToCache(products: Array<Product>): void {
    const pIds = this.$liveProducts.value.map((p) => p.id);
    const toAddPs = products.filter((p) => !pIds.includes(p.id));

    this.$liveProducts.next([...this.$liveProducts.value, ...toAddPs]);
  }

  public async getProductsByCategories(
    categoryIds: Array<string>,
    force: boolean = false
  ): Promise<Array<Product>> {
    // get from cache
    const liveCatsPs =
      this.$liveCatsProducts.value &&
      this.$liveCatsProducts.value[categoryIds.join('-')];

    if (!force && liveCatsPs) {
      return liveCatsPs;
    }

    try {
      const productR: any = await lastValueFrom(
        this.http.get(
          `${this.API_URLS.PRODUCTS.LIST}?categoryIds=${categoryIds}`
        )
      );

      const products = productR.map((p) => new Product(p));

      if (products?.length) {
        this.addToCache(products);
        this.$liveCatsProducts.next({
          ...(this.$liveCatsProducts.value || {}),
          [categoryIds.join('-')]: [...products]
        });
        return products;
      } else {
        return null;
      }
    } catch (error: any) {
      throw error;
    }
  }

  public async getProduct(
    id: string,
    force: boolean = false
  ): Promise<Product> {
    // get from cache
    const p = this.$liveProducts.value.find((p) => p.id === id);

    if (!force && p) {
      return p;
    }

    try {
      const productR: any = await lastValueFrom(
        this.http.get(`${this.API_URLS.PRODUCTS.LIST}/${id}`)
      );

      const product = new Product(productR);

      this.addToCache([product]);

      return product;
    } catch (error: any) {
      throw error;
    }
  }

  public async getProductsByIds(
    ids: Array<string>,
    force: boolean = false
  ): Promise<Array<Product>> {
    // get from cache
    let pCache = [];
    let notFoundIds = [];

    if (!force && this.$liveProducts.value?.length) {
      this.$liveProducts.value.forEach((p) => {
        if (ids.includes(p.id)) {
          pCache.push(p);
        } else {
          notFoundIds.push(p.id);
        }
      });

      if (!notFoundIds.length) {
        return pCache;
      }
    }

    try {
      const productR: any = await lastValueFrom(
        this.http.get(`${this.API_URLS.PRODUCTS.LIST}?ids=${notFoundIds}`)
      );

      const products = productR.map((p) => new Product(p));

      this.addToCache(products);
      return [...products, ...pCache];
    } catch (error: any) {
      throw error;
    }
  }
}

import { Injectable } from '@angular/core';

/**
 * UtilsService exports all the methods that provides some common utility.
 *
 * @export
 * @class UtilsService
 * @typedef {UtilsService}
 */
@Injectable({
  providedIn: 'root'
})
export class UtilsService {
  constructor() {}

  //

  /**
   * Replaces all upperCase letters to lowercase precided with '-' dash
   * @param str
   * @returns dashed string
   */
  public camelCaseToDashCase(str: string): string {
    if (!str) return '';
    return str
      .split('')
      .map((c) => (c === c.toUpperCase() ? `-${c.toLowerCase()}` : c))
      .join('');
  }

  /**
   * Joins the Url segments and forms a url, stripes out any trailing extra slashes from the segments before joing them.
   * @param urlSegments
   * @returns joined Urls
   */
  public joinUrl(urlSegments: Array<string>): string {
    const cleanedSegmenmts = urlSegments.map((str, index) => {
      let cleanSegment = str;

      switch (index) {
        case 0:
          if (str.endsWith('/')) {
            cleanSegment = str.substring(0, str.length - 2);
          }
          break;
        case urlSegments.length - 1:
          if (str.startsWith('/')) {
            cleanSegment = str.substring(1, str.length);
          }
          break;
        default:
          if (cleanSegment.endsWith('/')) {
            cleanSegment = cleanSegment.substring(0, cleanSegment.length - 2);
          }

          if (cleanSegment.startsWith('/')) {
            cleanSegment = cleanSegment.substring(1, cleanSegment.length);
          }
      }

      return cleanSegment;
    });

    return cleanedSegmenmts.join('/');
  }

  /**
   * Returns the current Date from browser in the ISO format.
   *
   * @public
   * @readonly
   * @type {string}
   */
  public get currentDate(): string {
    return new Date().toISOString();
  }

  /**
   * Returns a local date string
   * @date 26/2/2022 - 9:48:21 am
   *
   * @public
   * @param {string} date
   * @returns {string}
   */
  public dateToLocalString(date: string = ''): string {
    if (!date) return '';
    const options: any = { year: 'numeric', month: 'short', day: 'numeric' };
    const dt = new Date(date);
    return dt.toLocaleDateString('en-US', options);
  }

  /**
   * Converts ISOString date string to its equivalent time in milliseconds since 1970, returns numeric value as a string.
   * @date 12/28/2022 - 6:04:39 PM
   *
   * @public
   * @param {string} dateStr
   * @returns {string}
   */
  public dateStringToTotalTimeString(dateStr: string): string {
    let timeStr = '';

    try {
      if (dateStr) {
        const dt = new Date(dateStr);
        timeStr = dt.getTime().toString();
      }
    } catch (err) {}

    return timeStr;
  }

  /**
   * Converts total time in milliseconds since 1970 (numbered string) to its equivalent ISOString date string.
   * @date 12/28/2022 - 6:04:39 PM
   *
   * @public
   * @param {string} timeStr
   * @returns {string}
   */
  public totalTimeStringToUTCdateString(timeStr: string): string {
    let dateStr = '';

    try {
      if (timeStr) {
        dateStr = new Date(Number(timeStr)).toISOString();
      }
    } catch (err) {}

    return dateStr;
  }

  /**
   * Stripe out all special characters from the string too except A-Z, a-z, 0-9.
   * @date 2/12/2023 - 2:01:20 PM
   *
   * @public
   * @param {string} str
   * @returns {string}
   */
  public getStringWithNoSpecialChars(str: string): string {
    if (!str) return '';
    const strArr = str.split('');
    const filteredStr = strArr.filter((char) => {
      if (
        (char >= 'A' && char <= 'Z') ||
        (char >= 'a' && char <= 'z') ||
        (char >= '0' && char <= '9') ||
        char === ' '
      ) {
        return true;
      } else {
        return false;
      }
    });

    return filteredStr.join('');
  }

  /**
   * Trims out additional consecutive spaces from a string, also trims spaces from end of the string.
   * @date 2/12/2023 - 9:54:48 PM
   *
   * @public
   * @param {string} str
   * @returns {string}
   */
  public trimConsecutiveSpaces(str: string): string {
    if (!str) return '';

    return str
      .split('')
      .filter((char, index) => {
        if (char === ' ') {
          if (index === str.length - 1) {
            return false;
          } else if (str[index + 1] === ' ') {
            return false;
          } else {
            return true;
          }
        } else {
          return true;
        }
      })
      .join('');
  }

  /**
   * Converts a string into dashed string. All spaces are replaced with dashes.
   * This converted string can be used for getting a unique name for a title of any content like, article etc.
   *
   * @param title
   * @returns
   */
  public toDashedString(title: string = ''): string {
    // trims additional spaces from a string.
    const spacesTrimmedStr = this.trimConsecutiveSpaces(title);
    // Stripe out all special characters from the string too except A-Z, a-z, 0-9.
    const titleWithNoSpecialChars =
      this.getStringWithNoSpecialChars(spacesTrimmedStr);
    return titleWithNoSpecialChars.split(' ').join('-').toLocaleLowerCase();
  }

  /**
   * Scrolls the page to the desired top position.
   * @date 25/2/2022 - 5:28:11 pm
   *
   * @public
   * @param {number} top
   */
  public scrollTo(top: number = 0) {
    if (typeof window !== 'undefined') {
      window.scrollTo({ top: top });
    }
  }

  public getTrimmedStringByChars(str: string, count: number = 0): string {
    if (!str || typeof str !== 'string' || !count || count <= 0) {
      return str;
    }

    return str.substring(0, count) + '...';
  }

  /**
   * Generates a unique ID from a string by adding dashes for spaces and adding a unique string.
   * @date 14/4/2022 - 2:39:05 pm
   *
   * @public
   * @param {string} [str='']
   * @returns {string}
   */
  public getUniqueFromString(str: string = ''): string {
    const dashed = this.toDashedString(str);
    const rndStr = Math.random().toString(36).substring(2);
    const uniqueId =
      Date.now().toString(36) + rndStr.substring(rndStr.length / 3);

    return `${dashed}-${uniqueId}`;
  }

  /**
   * Deep copy an object or an array
   * @date 2/28/2023 - 3:22:38 AM
   *
   * @public
   * @param {(any)} value
   * @returns {(any)}
   */
  public deepCopy(value: any): any {
    try {
      return JSON.parse(JSON.stringify(value));
    } catch (err) {
      return null;
    }
  }

  public delay(miliseconds: number): Promise<unknown> {
    return new Promise((resolve) => setTimeout(resolve, miliseconds));
  }

  /**
   * Generates Image source urls to be displayed from API.
   * Note: Do not provide base url, while saving urls to db, but while displaying only.
   * @date 6/4/2023 - 12:27:34 AM
   *
   * @public
   * @param {string} imageFullPath
   * @param {string} imageApiEndpoint
   * @param {string} [baseUrl='']
   * @returns {string}
   */
  public getImageUrl(
    imageFullPath: string,
    imageApiEndpoint: string,
    baseUrl: string = ''
  ): string {
    const imageApiUrl = `${imageApiEndpoint}${imageFullPath}`;
    return baseUrl ? this.joinUrl([baseUrl, imageApiUrl]) : imageApiUrl;
  }

  /**
   * Generates the canonical categiry or article url.
   * Note: Do not provide base url, while saving urls to db, but while displaying only.
   * @date 6/4/2023 - 12:17:52 AM
   *
   * @public
   * @param {string} categoryid
   * @param {string} [articleId='']
   * Provide only when displaying the url, and not while saving to db.
   * @param {string} [baseUrl='']
   * @returns {string}
   */
  public getCanonicalUrl(
    categoryid: string,
    articleId: string = '',
    baseUrl: string = ''
  ): string {
    const articleSegment = articleId ? `/${articleId}` : '';
    const catId = categoryid.indexOf('/') === 0 ? categoryid : `/${categoryid}`;
    return baseUrl
      ? this.joinUrl([baseUrl, catId, articleSegment])
      : `${catId}${articleSegment}`;
  }

  /**
   * Replaces single quotes in a string with double quotes.
   * @param str
   * @returns
   */
  public replaceSingleWithDoubleQuotes(str: string): string {
    if (!str) return str;
    str = str.replace(/'/g, '"');

    return str;
  }

  /**
   * Removes double \\n chars from string.
   * @param str
   * @returns
   */
  public removeDoubleLineBreakChar(str: string): string {
    if (!str) return str;
    str = str.replace(/\\n/g, '\n');

    return str;
  }

  /**
   * Strips out starting and ending single/double quotes from a string.
   * @param str
   * @returns
   */
  public stripsOutQuotesFromStartAndEnd(str: string): string {
    if (!str) return str;

    if (
      (str.startsWith("'") && str.endsWith("'")) ||
      (str.startsWith('"') && str.endsWith('"'))
    ) {
      str = str.substring(1);
      str = str.substring(0, str.length - 1);
    }

    return str;
  }

  /**
   * Gives a natural comma separetd string from an array of strings.
   * Last comma in the string is replaced with 'and', being a natural language string.
   * @param stringArray
   * @returns string
   */
  public nauturalJoinArray(stringArray: Array<string>): string {
    return `${stringArray.slice(0, stringArray.length - 1).join(', ')} and ${
      stringArray[stringArray.length - 1]
    }`;
  }

  /**
   * Parses a remoteConfig (firebase) to a valid value. Removes intermediate nested vars
   */

  public getRemoteConfigValue(remoteConfig: any, key: string) {
    if (!remoteConfig || !key) return null;

    const param = remoteConfig.parameters[key];

    if (param) {
      const value = (param.defaultValue as any)?.value;

      if (param.valueType === 'JSON' && value) {
        return JSON.parse(value);
      }

      return value;
    }

    throw new Error(`Param - ${key} does not exist in global config.`);
  }

  /**
   * Converts Circular JSON strcuture to normal. To be used in JSON.stringify(object, JsonCircularStringifyReplacerFn, '\t')
   */
  public JsonCircularStringifyReplacerFn(): any {
    const visited = new WeakSet();
    return (key, value) => {
      if (typeof value === 'object' && value !== null) {
        if (visited.has(value)) {
          return;
        }
        visited.add(value);
      }
      return value;
    };
  }
}

