    this.offer = this.toNumeric(data?.offer);
    this.qty = this.toNumeric(data?.qty);
    this.price = this.toNumeric(data?.price);
    this.minDispatchTime = parseInt(data?.minDispatchTime || '0');
    this.maxDispatchTime = parseInt(data?.maxDispatchTime || '0');
    this.isLive = data?.isLive || false;
    this.createTime = data?.createTime || '';
    this.updateTime = data?.updateTime || '';
  }

  private toNumeric(value: Price | Qty | Offer): Price | Qty | Offer {
    if (!value) return null;

    const parsedValue = {};
    Object.keys(value).forEach((key) => {
      const keyValue = value[key].toString();
      parsedValue[key] = keyValue ? parseInt(keyValue) : keyValue;
    });

    return parsedValue;
  }

  public setSizes(v: Array<string>) {
    this.sizes = v || [];

    // Update Prices
    const newPrices = {};
    this.sizes.forEach((s) => {
      newPrices[s] = this.price[s] || 0;
    });
    this.price = newPrices;

    // Update Quantities
    const newQtys = {};
    this.sizes.forEach((s) => {
      newQtys[s] = this.qty[s] || 0;
    });
    this.qty = newQtys;
  }
}

